-- 冒泡排序函数
function bubbleSort(arr)
    local n = #arr
    for i = 1, n - 1 do
        for j = 1, n - i do
            if arr[j] > arr[j + 1] then
                -- 交换位置
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
            end
        end
    end
end

